var pageNotNull = [];
export default function App() {
  const products = useProducts();
  const pages = usePages();
  console.log(usePages());

  if (products !== null) {
    products.map(item => (
      productNotNull = item
    ))
    return(
      productNotNull.map(item => (
        <li key={item.id}>{item.name}</li>
      ))
    )
  }
  if (pages !== null) {
    pages.map( item => (
      pageNotNull = item
    ))
    return (
      pageNotNull.map(item => (
        <h1 key={item.id}>{item.title}</h1>
      ))
    )
  }
}
